import React, { useState, useEffect } from "react";
import End from "./End";
import axios from "axios";

export default function Start(props) {
  const [data, setData] = useState([{}]); //전체 데이터
  const [test, setTest] = useState(""); //문항
  const [page, setPage] = useState(1); //페이지

  function fetchData() {
    axios
      .get(
        "http://www.career.go.kr/inspct/openapi/test/questions?apikey=5894ecf675f64f28cd358b417ed6ad1b&q=6"
      )
      .then((response) => {
        const data = response.data.RESULT;
        setData(data);
      })
      .catch((Error) => {
        console.log(Error);
      });
  }
  useEffect(() => {
    fetchData();
  }, []);

  //버튼 누르면 다음문항으로 이동
  const changePage = () => {
    console.log("다음문항으로이동");
  };
  //페이지 증가
  const onChangePage = () => {
    setPage(page + 1);
  };

  return (
    <>
      {/* <div>
        <button onClick={changePage}>냥냥</button>
        {page === 1 ? <Component1 /> : <Component2 />}
      </div> */}
      <div>
        문항 {console.log(data)};
        {data.slice(0, 5).answer01.data.slice(0, 5).answer02}
        {data.map((jsondata, idx) => {
          return (
            <>
              <div>
                <label>
                  <input
                    type="radio"
                    name={idx + 1}
                    value={jsondata.answer01}
                    onChange={onChangePage}
                  />
                  {jsondata.answer01}
                </label>
                <label>
                  <input
                    type="radio"
                    name={idx + 1}
                    value={jsondata.answer02}
                    onChange={onChangePage}
                  />
                  {jsondata.answer02}
                </label>
              </div>
              <br></br>
            </>
          );
        })}
        <button disabled={test == "" ? true : false} onClick={changePage}>
          다음
        </button>
        <br></br>
        <br></br>
      </div>
    </>
  );
}
